      <Box p={15} pt={15} >
      <Grid container spacing={5}>
        {
          movies.map(movie => <MovieDisplay key={movie._id} data={movie}></MovieDisplay>)
        }
      </Grid>
    </Box>
      <Checkbox {...label} />
      {/* <Checkbox {...label} disabled checked /> */}
    </>)
}

